export default () => ({
  multiselectionCheckbox: {
    width: '20%',
  },

  extrasListsWrapper: {
    padding: '0 0 10px 0',
  },

  extrasListItem: {
    width: '50%',
    minWidth: 400,
  },

  extraItem: {
    paddingLeft: '1.3rem !important',
  },

  extraListInfo: {
    width: 'auto',
  },
});
